(94, 1, '2019-12-03 07:26:35', '2019-12-03 07:26:35', '<!-- wp:preformatted -->\n<p>Buffalo Billâ€™s Wings & Things is a fast casual restaurant located in the heart of Denver being famous for juicily, perfectly made and traditional Buffalo style wings delivering the classic East Coast flavor.<br>\n                                        Our restaurant mainly focuses on 2 things: the passion for our products and the passion for our guests.<br>\n                                        At Buffalo Billâ€™s Wings & Things, we only use the highest-quality ingredients with a special secret frying technique giving it an amazing crunch, while retaining its natural flavors. We also offer a wide range of dishes featuring unique and seductive flavors and unusual ingredients coming with some of the tastiest and most original side dishes you could ever imagine.</p>\n                                    <p>We may not be able to bring you to Buffalo, but we can bring Buffalo wings to you!<br>\n                                        Come and join us for the tastiest treat in town!</p>\n<!-- /wp:preformatted -->', 'Home', '', 'inherit', 'closed', 'closed', '', '7-revision-v1', '', '', '2019-12-03 07:26:35', '2019-12-03 07:26:35', '', 7, 'http://localhost/buffalo/7-revision-v1/', 0, 'revision', '', 0),
