(93, 1, '2019-12-03 07:26:09', '2019-12-03 07:26:09', '<!-- wp:preformatted -->\n<pre class=\"wp-block-preformatted\">Buffalo Billâ€™s Wings &amp; Things is a fast casual restaurant located in the heart of Denver being famous for juicily, perfectly made and traditional Buffalo style wings delivering the classic East Coast flavor.\n                                         Our restaurant mainly focuses on 2 things: the passion for our products and the passion for our guests.\n                                         At Buffalo Billâ€™s Wings &amp; Things, we only use the highest-quality ingredients with a special secret frying technique giving it an amazing crunch, while retaining its natural flavors. We also offer a wide range of dishes featuring unique and seductive flavors and unusual ingredients coming with some of the tastiest and most original side dishes you could ever imagine.\n <code>                                &lt;p>We may not be able to bring you to Buffalo, but we can bring Buffalo wings to you!&lt;br>                                     Come and join us for the tastiest treat in town!&lt;/p></code></pre>\n<!-- /wp:preformatted -->', 'Home', '', 'inherit', 'closed', 'closed', '', '7-revision-v1', '', '', '2019-12-03 07:26:09', '2019-12-03 07:26:09', '', 7, 'http://localhost/buffalo/7-revision-v1/', 0, 'revision', '', 0),
